import React from "react";
import './FaceRecognition.css';

const FaceRecognition = ({imageUrl, box}) => {
  return (
    <div className="center ma">
    <div className="absolute mt2 ">
      <img src={imageUrl} id="inputImage" alt="" width="auto" height="660px"/>
      <div className="bounding-box" style={{top: box.topRow, right: box.rightCol, bottom: box.bottomRow, lef: box.lefCol}}></div>
    </div>
    </div>
  );
};

export default FaceRecognition;


